import EditUserProfileUs from './Pages/User/UserDashboard/EditUserProfileUs';

class NetworkDetector extends Component {
  constructor(props) {
    super(props);
    this.state = {
      isDisconnected: false,
    };
  }

  componentDidMount() {
    this.handleConnectionChange();
    window.addEventListener('online', this.handleConnectionChange);
    window.addEventListener('offline', this.handleConnectionChange);
  }

  componentWillUnmount() {
    window.removeEventListener('online', this.handleConnectionChange);
    window.removeEventListener('offline', this.handleConnectionChange);
  }

  handleConnectionChange = () => {
    const condition = navigator.onLine ? 'online' : 'offline';
    if (condition === 'online') {
      const webPing = setInterval(() => {
        fetch('//google.com', {
          mode: 'no-cors',
        })
          .then(() => {
            this.setState({ isDisconnected: false }, () => {
              return clearInterval(webPing);
            });
          })
          .catch(() => this.setState({ isDisconnected: true }));
      }, 2000);
      return;
    }

    return this.setState({ isDisconnected: true });
  };

  render() {
    const { isDisconnected } = this.state;
    return (
      <div>
        {isDisconnected ? (
          <main className="pageContent error">
            {/* <div className="error-page">
              <img src="./assets/img/OOPS.svg" alt="" />
              <div className='text-center'>
                <h3>Whoops!</h3>
                <p>Slow or no internet connection.</p>
                <p>Please Check your internet setting</p>
              </div>
            </div> */}

            <div
              className='error-page'
              style={{
                background:
                  "url('data:image/jpeg;base64,') no-repeat",
                backgroundPosition: 'bottom',
                height: '100vh',
                backgroundColor: '#fff',
                display: 'flex',
                justifyContent: 'center',
                aligntems: 'center',
              }}
            >
              <div className='container'>
                <div className='error-content'>
                  <img src='data:image/png;base64,' />

                  <h3>Whoops!</h3>
                  <p>Slow or no internet connection.</p>
                  <p>Please Check your internet setting</p>
                  {/* <button
                      onClick={() => {
                        window.location.reload();
                      }}
                      type='submit'
                      class='waves-effect waves-light btn white-text w-60 mb-4'
                    >
                      Click To Refresh
                    </button> */}
                </div>
              </div>
            </div>

          </main>
        ) : (
          <Router >
            <Routes basename={'/app'}>

              <Route exact path='/' element={<LandingPage />} />
              {/* <Route exact path='/landing-page' element={<LandingPage />} /> */}
              <Route path='/next' element={<Screen2 />} />
              <Route path='/login' element={<Login />} />
              <Route path="/forgot-password" element={<ForgotPassword />} />
              <Route path='/register-option' element={<RegisterOption />} />
              <Route path='/user-register' element={<UserRegister />} />
              <Route path='/vendor-register' element={<VendorRegister />} />
              <Route path="/update-password" element={<UpdatePassword />} />
              <Route path="/tp-terms" element={<TpTerms />} />
              <Route path="/TPJoin" element={<TPJoin />} />

              {/* user */}
              <Route path="/user-dashboard" element={<UserDashboard />} />
              <Route path="/vendor-dashboard" element={<VendorDashboard />} />
              <Route path='/message-admin' element={<MessageToAdmin />} />
              <Route path='/change-password' element={<ChangePassword />} />
              <Route path='/delete-account' element={<DeleteAccount />} />
              <Route path='/payment-screen' element={<PaymentScreen />} />
              <Route path='/payment-screen-2/:name/:tenure/:price' element={<PaymentScreen2 />} />

              <Route path="/TpProviderInfo/:user_id" element={<TpProviderInfo />} />
              <Route path="/edit-vendor-profile" element={<EditVendorProfile />} />
              <Route path='/faq-user' element={<UserFaqs />} />
              <Route path='/faq-vendor' element={<VendorFaqs />} />
              <Route path='/vendor-info' element={<VendorInfo />} />
              <Route path='/footer-pages' element={<Footer />} />

              <Route path='/about' element={<AboutUs />} />
              <Route path='/how-it-works' element={<HowItWorks />} />
              <Route path='/contact-us' element={<ContactUs />} />

              <Route path='/careers' element={<Careers />} />
              <Route path="/select-subscription" element={<SubscriptionPackage />} />
              <Route path='/edit-user-profile' element={<EditUserProfile />} />
              <Route path='/new-booking' element={<NewBooking />} />
              <Route path="/select-tp" element={<SelectTP />} />
              <Route path="/send-quote" element={<SendQuotation />} />
              <Route path="/manage-Quotation/:tab_id" element={<ManageQuotation />} />
              <Route path="/manage-Payments/:tab_id" element={<ManagePayments />} />
              <Route path="/Trip-status/:tab_id" element={<TripStatus />} />
              <Route path='/cookie-policy' element={<CookiePolicy />} />
              <Route path="/privacy-policy" element={<PrivacyPolicy />} />
              <Route path='/terms-of-use' element={<TermsCondition />} />
              <Route path='/complete-user-profile' element={<CompleteUserProfile />} />
              <Route path="/:id" element={<Notification />} />

              {/* vendor */}
              <Route path="/quote-management/:tab_id" element={<QuoteManage />} />
              <Route path="/manage-pay/:tab_id" element={<ManagePayment />} />
              <Route path="/manage-trip/:tab_id" element={<ManageTrip />} />
              <Route path="/new-rating/:uId/:vId/:qId" element={<Ratings />} />
              <Route path="/view-rating/:uId/:vId/:qId" element={<ViewRating />} />
              <Route path="/rating" element={<RatingReview />} />
              <Route path="/ratings" element={<Rating />} />
              <Route path="/vendor-message-admin" element={<VendorMsgToAdmin />} />
              <Route path="/complete-vendor-profile" element={<CompleteVendorProfile />} />
              <Route path="/thank-you" element={<ThankYou />} />

              {/* US App Routes */}
              <Route path='/vendor-register-us' element={<VendorRegisterUs />} />
              <Route path='/complete-vendor-profile-us' element={<CompleteVendorProfileUs />} />
              <Route path='/edit-vendor-profile-us' element={<EditVendorProfileUs/> } />
              <Route path='/complete-user-profile-us' element={<CompleteUserProfileUs/> } />
              <Route path='/edit-user-profile-us' element={<EditUserProfileUs/> } />
            </Routes>
          </Router>

        )}
      </div>
    );
  }
}

export default NetworkDetector;